styles:
:host {
  display: block;
}
.ngb-dp-weekday, .ngb-dp-week-number {
  line-height: 2rem;
  text-align: center;
  font-style: italic;
}
.ngb-dp-weekday {
  color: #5bc0de;
  color: var(--info);
}
.ngb-dp-week {
  border-radius: 0.25rem;
  display: -ms-flexbox;
  display: flex;
}
.ngb-dp-weekdays {
  border-bottom: 1px solid rgba(0, 0, 0, 0.125);
  border-radius: 0;
}
.ngb-dp-day, .ngb-dp-weekday, .ngb-dp-week-number {
  width: 2rem;
  height: 2rem;
}
.ngb-dp-day {
  cursor: pointer;
}
.ngb-dp-day.disabled, .ngb-dp-day.hidden {
  cursor: default;
}

:host {
  text-align: center;
  width: 2rem;
  height: 2rem;
  line-height: 2rem;
  border-radius: 0.25rem;
  background: transparent;
}
:host.outside {
  opacity: 0.5;
}

:host {
  display: -ms-flexbox;
  display: flex;
  align-items: center;
}
.ngb-dp-navigation-chevron {
  border-style: solid;
  border-width: 0.2em 0.2em 0 0;
  display: inline-block;
  width: 0.75em;
  height: 0.75em;
  margin-left: 0.25em;
  margin-right: 0.15em;
  transform: rotate(-135deg);
  -ms-transform: rotate(-135deg);
}
.right .ngb-dp-navigation-chevron {
  -ms-transform: rotate(45deg);
  transform: rotate(45deg);
  margin-left: 0.15em;
  margin-right: 0.25em;
}
.ngb-dp-arrow {
  display: -ms-flexbox;
  display: flex;
  -ms-flex: 1 1 auto;
  flex-grow: 1;
  padding-right: 0;
  padding-left: 0;
  margin: 0;
  width: 2rem;
  height: 2rem;
}
.ngb-dp-arrow.right {
  -ms-flex-pack: end;
  justify-content: flex-end;
}
.ngb-dp-arrow-btn {
  padding: 0 0.25rem;
  margin: 0 0.5rem;
  border: none;
  background-color: transparent;
  z-index: 1;
}
.ngb-dp-arrow-btn:focus {
  outline: auto 1px;
}
.ngb-dp-month-name {
  font-size: larger;
  height: 2rem;
  line-height: 2rem;
  text-align: center;
}
.ngb-dp-navigation-select {
  display: -ms-flexbox;
  display: flex;
  -ms-flex: 1 1 9rem;
  flex-grow: 1;
  flex-basis: 9rem;
}

:host>select {
  display: flex;
  display: -ms-flexbox;
  -ms-flex: 1 1 auto;
  width: 100%;
  padding: 0 0.5rem;
  font-size: 0.875rem;
  height: 1.85rem;
}

:host {
  border: 1px solid #dfdfdf;
  border-radius: 0.25rem;
  display: inline-block;
}
.ngb-dp-month {
  pointer-events: none;
}
.ngb-dp-header {
  border-bottom: 0;
  border-radius: 0.25rem 0.25rem 0 0;
  padding-top: 0.25rem;
}
ngb-datepicker-month-view {
  pointer-events: auto;
}
.ngb-dp-month-name {
  font-size: larger;
  height: 2rem;
  line-height: 2rem;
  text-align: center;
}
/deep/ .ngb-dp-month + .ngb-dp-month > ngb-datepicker-month-view > .ngb-dp-week {
  padding-left: 1rem;
}
/deep/ .ngb-dp-month + .ngb-dp-month > .ngb-dp-month-name {
  padding-left: 1rem;
}
/deep/ .ngb-dp-month:last-child .ngb-dp-week {
  padding-right: .25rem;
}
/deep/ .ngb-dp-month:first-child .ngb-dp-week {
  padding-left: .25rem;
}
/deep/ .ngb-dp-month > ngb-datepicker-month-view > .ngb-dp-week:last-child {
  padding-bottom: .25rem;
}
.ngb-dp-months {
  display: -ms-flexbox;
  display: flex;
}

:host.bs-popover-top .arrow, :host.bs-popover-bottom .arrow {
  left: 50%;
  margin-left: -5px;
}

:host.bs-popover-top-left .arrow, :host.bs-popover-bottom-left .arrow {
  left: 2em;
}

:host.bs-popover-top-right .arrow, :host.bs-popover-bottom-right .arrow {
  left: auto;
  right: 2em;
}

:host.bs-popover-left .arrow, :host.bs-popover-right .arrow {
  top: 50%;
  margin-top: -5px;
}

:host.bs-popover-left-top .arrow, :host.bs-popover-right-top .arrow {
  top: 0.7em;
}

:host.bs-popover-left-bottom .arrow, :host.bs-popover-right-bottom .arrow {
  top: auto;
  bottom: 0.7em;
}

:host {
  font-size: 1rem;
}

.ngb-tp {
  display: -ms-flexbox;
  display: flex;
  -ms-flex-align: center;
  align-items: center;
}

.ngb-tp-input-container {
  width: 4em;
}

.ngb-tp-hour, .ngb-tp-minute, .ngb-tp-second, .ngb-tp-meridian {
  display: -ms-flexbox;
  display: flex;
  -ms-flex-direction: column;
  flex-direction: column;
  -ms-flex-align: center;
  align-items: center;
  -ms-flex-pack: distribute;
  justify-content: space-around;
}

.ngb-tp-spacer {
  width: 1em;
  text-align: center;
}

.chevron::before {
  border-style: solid;
  border-width: 0.29em 0.29em 0 0;
  content: '';
  display: inline-block;
  height: 0.69em;
  left: 0.05em;
  position: relative;
  top: 0.15em;
  transform: rotate(-45deg);
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  vertical-align: middle;
  width: 0.71em;
}

.chevron.bottom:before {
  top: -.3em;
  -webkit-transform: rotate(135deg);
  -ms-transform: rotate(135deg);
  transform: rotate(135deg);
}

input {
  text-align: center;
}

:host.bs-tooltip-top .arrow, :host.bs-tooltip-bottom .arrow {
  left: calc(50% - 0.4rem);
}

:host.bs-tooltip-top-left .arrow, :host.bs-tooltip-bottom-left .arrow {
  left: 1em;
}

:host.bs-tooltip-top-right .arrow, :host.bs-tooltip-bottom-right .arrow {
  left: auto;
  right: 0.8rem;
}

:host.bs-tooltip-left .arrow, :host.bs-tooltip-right .arrow {
  top: calc(50% - 0.4rem);
}

:host.bs-tooltip-left-top .arrow, :host.bs-tooltip-right-top .arrow {
  top: 0.4rem;
}

:host.bs-tooltip-left-bottom .arrow, :host.bs-tooltip-right-bottom .arrow {
  top: auto;
  bottom: 0.4rem;
}
